import React from "react";
import Titlecard from "../components/Titlecard"

const TitleSection = () => {
  return (
    <>
      <container>
        <div></div>
        <div className="text-[10rem]">
          <h1>Mateo</h1>
        </div>
      </container>
    </>
  );
};

const HomePage = () => {
  return (
    <div>
      <TitleSection />
    </div>
  );
};

export default HomePage;
